import React, { useState } from "react";
import Histogram from "./Histogram";
import ScatterPlot from "./ScatterPlot";
import StackedBarChart from "./StackedBarChart";
import BubbleChart from "./BubbleChart";
import RadarChart from "./RadarChart";

const SelectVisualization = () => {
  const [selectedOption, setSelectedOption] = useState(null);

  const handleChange = (event) => {
    setSelectedOption(event.target.value);
  };

  const Visualizations = () => {
    switch (selectedOption) {
      case "Histogram":
        return <Histogram />;
      case "ScatterPlot":
        return <ScatterPlot />;
      case "StackedBarChart":
        return <StackedBarChart />;
      case "BubbleChart":
        return <BubbleChart />;
      case "RadarChart":
        return <RadarChart />;
      default:
        return null;
    }
  };

  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        backgroundColor: "#f2f2f2",
        padding: "50px",
        borderRadius: "10px",
        boxShadow: "0px 5px 10px #888888",
      }}
    >
      <h2 style={{ color: "#1DB954" }}>Select a Visualization</h2>
      <div style={{ marginBottom: "20px" }}>
        <select value={selectedOption} onChange={handleChange}>
          <option value="">Select an option</option>
          <option value="Histogram">Histogram of Album Release Dates</option>
          <option value="ScatterPlot">Scatter Plot of Song Popularity vs. Duration</option>
          <option value="StackedBarChart">Stacked Bar Chart Showing Popularity of Songs by Each Artist</option>
          <option value="BubbleChart">Bubble Chart Showing Relationship Between Album Release Date, Album Popularity, and Number of Tracks</option>
          <option value="RadarChart">Radar Chart Showing Popularity of an Artist's Top 10 Songs</option>
        </select>
      </div>
      {renderVisualization()}
    </div>
  );
};

export default Visualizations;
